import "./style.css";

import tg from "../../img/icon/tg.svg";

const  TelegramIcon = () => {
    return (
        <a href="#" className="icon-link">
            <img src={tg} alt="telegram" className="icon-img" />
        </a>
    );
}
 


export default TelegramIcon;
